angular.module("myApp", ["ngAnimate", "firebase"]).controller("ctrlmusikex", function (o, t) {
    var e = "js/datos.json";
    t.get(e).then(function (t) {
        o.generos = t.data
    })
}).controller("ctrlFire", function (o, t) {
    var e = new Firebase("https://musicajorge.firebaseio.com/");
    o.listaProductos = t(e), o.agregarProducto = function () {
        o.listaProductos.$add({nombre: o.producto}), o.producto = ""
    }, o.eliminarProducto = function () {
        var t = o.listaProductos.length, e = o.listaProductos[t - 1];
        o.listaProductos.$remove(e)
    }
}).controller("TabsController", function () {
    this.tab = 1, this.selectTab = function (o) {
        this.tab = o
    }
}).filter("imageify", function () {
    return function (o) {
        var t = "img/pokemons/" + o.toLowerCase() + ".jpg";
        return t
    }
}).controller("CommentsController", function () {
    this.comments = [], this.show = !1, this.toggle = function () {
        this.show = !this.show
    }
}).controller("PokemonController", function () {
    this.pokemon = {
        id: "001",
        name: "Bulbasaur",
        species: "Seed Pokémon",
        type: ["Grass", "Poison"],
        height: "2′4″ (0.71m)",
        weight: "15.2 lbs (6.9 kg)",
        abilities: ["Overgrow", "Chlorophyll"],
        stats: {hp: 45, attack: 49, defense: 49, "sp.atk": 65, "sp.def": 65, speed: 45, total: 318},
        evolution: ["Bulbasaur", "Ivysaur", "Venusaur"]
    }
}), $(document).ready(function () {
    var o = $("#panel_player").empty();
    o.load("00_mejores/index.php")
});